    let arrColor=['#729f3f','linear-gradient(180deg, #53a4cf 50%, #f16e57 50%)','#fdb9e9,']
    return(
        <Col span={11} className="abilities">
            <Link to={'/type/'+props.values}>{props.values}</Link>
        </Col>
    )
}
export default Type
